import React, { Component } from "react";
import logo from "../assets/Logo/BrainFlix-logo.svg";
import headerIcon from "../assets/Images/Mohan-muruge.jpg";
import glassIcon from "../assets/Icons/search.svg";
import uploadIcon from "../assets/Icons/upload.svg";

export default class Header extends Component {
  render() {
    return (
      <div className="header">
        <div className="header__logo-container">
          <a href="">
            <img className="header__logo" src={logo} alt="logo" />
          </a>
        </div>
        <div className="header__search-icon-main">
          <div className="header__search-container">
            <img
              className="header__search-glass-icon"
              src={glassIcon}
              alt="glass-icon"
            />
            <input
              className="header__search-box"
              type="text"
              placeholder="Search"
            />
          </div>
          <img className="header__icon" src={headerIcon} alt="headerIcon" />
        </div>
        <div className="header__upload-container">
          <img
            className="header__upload-icon"
            src={uploadIcon}
            alt="uploadIcon"
          />
          <button className="header__upload-button">Upload</button>
        </div>
      </div>
    );
  }
}
